// BlogPost.js
import React from "react";

const BlogPost = ({ blogPosts }) => (
    <div className="blog-posts-container">
        {blogPosts.map((post) => (
            <div key={post.id} className="blog-post">
                <img
                    src={post.imageUrl}
                    alt={post.title}
                    style={{ width: "100%", height: "200px", marginBottom: "10px" }}
                />
                <h2>{post.title}</h2>
                <p>{post.content}</p>
            </div>
        ))}
    </div>
);

export default BlogPost;
